    data: |
      SELECT tab0.col1 * - col1 + col2 * - col2 / - col2 AS col1 FROM tab0 (FORMAT parquet) WHERE col2 / col0 NOT IN ( + tab0.col2 );
  - name: tab0

outputs:
  - name: q5566.out
    data: |
      -7363
      -8199
      -9408
